import Hello,{ Demo } from '../components/Hello';
import { connect } from 'react-redux'
import {
    INCREMENT_ENTHUSIASM
} from '../constants'

interface DemoStore {
    demoStore:Demo
}


const mapStateToProps = (state:DemoStore):object =>{
    return {
        demoStore:state.demoStore
    }
}

export const mapDispatchToProps = (dispatch: any) => {
    return{
        onIncrement:(Id:string) => dispatch({type:INCREMENT_ENTHUSIASM,Id}),
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(Hello);

